рЃДрЃЋрЃћрЃџрЃљрЃќрЃћ рЃфрЃюрЃЮрЃЉрЃўрЃџрЃў рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃБрЃџрЃў рЃърЃарЃћрЃЏрЃўрЃљ рЃАрЃљрЃЉрЃљрЃА рЃЪрЃўрЃБрЃарЃўрЃЏ рЃгрЃџрЃћрЃЋрЃљрЃюрЃЊрЃћрЃџрЃў рЃЊрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃћрЃЉрЃўрЃА рЃцрЃўрЃюрЃљрЃџрЃўрЃАрЃбрЃћрЃЉрЃў рЃњрЃљрЃЏрЃЮрЃљрЃЋрЃџрЃўрЃюрЃљ. рЃЊрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃћрЃЉрЃљ рЃЏрЃћрЃЌрЃЋрЃарЃљрЃЏрЃћрЃбрЃћрЃЊ рЃўрЃЏрЃљрЃарЃЌрЃћрЃЉрЃљ рЃЊрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЦрЃЮрЃЏрЃљрЃњрЃћрЃЉрЃА рЃБрЃЎрЃЋрЃћ рЃерЃћрЃБрЃФрЃџрЃўрЃљрЃЌ рЃюрЃљрЃ«рЃЮрЃю, рЃЌрЃБ рЃЋрЃўрЃю рЃўрЃЉрЃарЃФрЃЮрЃџрЃћрЃЉрЃА рЃгрЃћрЃџрЃА рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА: рЃгрЃџрЃўрЃА рЃАрЃљрЃБрЃЎрЃћрЃЌрЃћрЃАрЃЮ рЃарЃЮрЃЏрЃљрЃюрЃў: - рЃЉрЃћрЃАрЃЮ рЃАрЃЮрЃџрЃЮрЃЏрЃљрЃюрЃљрЃерЃЋрЃўрЃџрЃў, рЃљрЃЏрЃЉрЃљрЃЋрЃў рЃФрЃЋрЃћрЃџрЃў рЃЊрЃљрЃ«рЃЋрЃарЃћрЃбрЃўрЃџрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃљрЃ«рЃљрЃџрЃў рЃЊрЃљрЃАрЃљрЃ«рЃЋрЃарЃћрЃбрЃћрЃЉрЃўрЃАрЃљ (рЃАрЃБрЃџрЃљрЃЎрЃљрЃБрЃарЃўрЃА рЃњрЃљрЃЏрЃЮрЃЏрЃфрЃћрЃЏрЃџрЃЮрЃЉрЃљ) - рЃљрЃюрЃљ рЃЎрЃЮрЃарЃФрЃљрЃўрЃљ-рЃАрЃљрЃЏрЃљрЃЊрЃљрЃерЃЋрЃўрЃџрЃў, рЃќрЃўрЃюрЃЎрЃљ рЃљрЃЊрЃљрЃЏрЃўрЃљрЃюрЃў (рЃАрЃБрЃџрЃљрЃЎрЃљрЃБрЃарЃўрЃА рЃњрЃљрЃЏрЃЮрЃЏрЃфрЃћрЃЏрЃџрЃЮрЃЉрЃљ) - рЃџрЃљрЃерЃљ рЃЉрЃБрЃдрЃљрЃФрЃћ, рЃљрЃБрЃЊрЃўрЃбрЃЮрЃарЃўрЃљ (рЃАрЃБрЃџрЃљрЃЎрЃљрЃБрЃарЃўрЃА рЃњрЃљрЃЏрЃЮрЃЏрЃфрЃћрЃЏрЃџрЃЮрЃЉрЃљ) - рЃљрЃЎрЃљ рЃЏрЃЮрЃарЃЕрЃўрЃџрЃљрЃФрЃћ, рЃцрЃљрЃарЃерЃљрЃЋрЃљрЃюрЃњрЃў (рЃА
..........
) - рЃАрЃљрЃџрЃЮрЃЏрЃћ рЃљрЃцрЃ«рЃљрЃќрЃўрЃерЃЋрЃўрЃџрЃў, рЃАрЃЮрЃфрЃўрЃљрЃџрЃБрЃарЃў рЃАрЃўрЃфрЃўрЃџрЃў (рЃАрЃБрЃџрЃљрЃЎрЃљрЃБрЃарЃўрЃА рЃњрЃљрЃЏрЃЮрЃЏрЃфрЃћрЃЏрЃџрЃЮрЃЉрЃљ) рЃгрЃџрЃўрЃА рЃАрЃљрЃБрЃЎрЃћрЃЌрЃћрЃАрЃЮ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃБрЃџрЃў рЃЊрЃћрЃЉрЃўрЃБрЃбрЃў: - рЃЏрЃљрЃўрЃљ рЃфрЃўрЃарЃљрЃЏрЃБрЃљ, рЃЏрЃерЃЋрЃўрЃЊрЃЮрЃЉрЃўрЃЌ, рЃФрЃўрЃљ рЃњрЃћрЃарЃерЃЋрЃўрЃю! (рЃгрЃўрЃњрЃюрЃћрЃЉрЃў рЃЉрЃљрЃЌрЃБрЃЏрЃерЃў) - рЃћрЃџрЃўрЃАрЃЮ рЃцрЃљрЃюрЃфрЃ«рЃљрЃЋрЃљ, рЃърЃЮрЃџ рЃЮрЃАрЃбрЃћрЃарЃўрЃА 4 3 2 1 (рЃгрЃўрЃњрЃюрЃћрЃЉрЃў рЃЉрЃљрЃЌрЃБрЃЏрЃерЃў) - рЃЏрЃљрЃарЃЌрЃљ рЃБрЃарЃБрЃерЃљрЃФрЃћ, рЃЏрЃћрЃ«рЃљрЃЏрЃарЃўрЃЊрЃў (рЃўрЃюрЃбрЃћрЃџрЃћрЃЦрЃбрЃў) - рЃюрЃўрЃюрЃў рЃћрЃџрЃўрЃљрЃерЃЋрЃўрЃџрЃў, рЃгрЃћрЃарЃбрЃўрЃџрЃўрЃА рЃерЃћрЃЏрЃЊрЃћрЃњ (рЃўрЃюрЃбрЃћрЃџрЃћрЃЦрЃбрЃў) - рЃЏрЃљрЃЎрЃљ рЃфрЃ«рЃЋрЃћрЃЊрЃўрЃљрЃюрЃў, рЃњрЃљрЃАрЃбрЃЮрЃюрЃўрЃА рЃЎрЃарЃћрЃърЃћрЃарЃўрЃљ (рЃўрЃюрЃбрЃћрЃџрЃћрЃЦрЃбрЃў) - рЃљрЃарЃЕрЃўрЃџ рЃцрЃўрЃарЃўрЃљрЃерЃЋрЃўрЃџрЃў, рЃцрЃћрЃ«рЃЉрЃБрЃарЃЌрЃўрЃА рЃЏрЃЮрЃЌрЃљрЃЏрЃљрЃерЃћ (рЃърЃљрЃџрЃўрЃбрЃарЃљ L) рЃгрЃџрЃўрЃА рЃАрЃљрЃБрЃЎрЃћрЃЌрЃћрЃАрЃЮ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃБрЃџрЃў рЃЎрЃарЃўрЃбрЃўрЃЎрЃљ: - рЃњрЃБрЃарЃљрЃЏ рЃџрЃћрЃЉрЃљрЃюрЃўрЃФрЃћ, рЃарЃўрЃџрЃЎрЃћрЃА рЃћрЃџрЃћрЃњрЃўрЃћрЃЉрЃў (рЃЎрЃљрЃЋрЃЎрЃљрЃАрЃўрЃБрЃарЃў рЃАрЃљрЃ«рЃџрЃў) - рЃарЃљрЃЏрЃљрЃќ
